INSERT INTO `associates` (`associate_id`, `associate_name`, `associate_history`, `associate_desc`, `associate_product`, `associate_contact`, `associate_pic`, `associate_pic2`, `iso_pic`, `is_display`, `associate_name2`) VALUES
(1, 'PT HALIM SARANA CAHAYA SEMESTA', 'Trading Company in various kind of Speciaty and Industrial Chemicals, covering Surabaya market and east part of Indonesia.<br /><br />', 'Gedung Halim Sakti, 6th & 7th floor <br />\nJl. HR. Muahmmad no. 41 <br />\nSurabaya ? 60189, <br />\nIndonesia <br />\nTelp. (62-31) 7388322, 7388333 <br />\nFax. (62-31) 7388329, 7388339 <br /> \nE-mail : hscs@halim-sakti.com <br /><br />', '374,375,376,377,378,379,380,381,382', 'sales of PT HALIM SARANA CAHAYA SEMESTA <br /> Telp. (62-31) 7388322, 7388333 <br />\nFax. (62-31) 7388329, 7388339 <br /> <br />', 'hscs_logo.gif', 'hscs_pic.jpg', NULL, 'no', NULL),
(2, 'PT HALIM SAMUDRA INTERUTAMA', '<p>PT HALIM SAMUDRA INTERUTAMA was established in July 1989 as a Joint Venture Company between Indonesia (PT HALIM SAKTI), Japan (CBC Co., LTD. Tokyo) and Korea (LG CHEMICAL LTD, Seoul).</p>\r\n<p>PT HALIM SAMUDRA INTERUTAMA is a Plastic Compounds and Masterbatches Manufacturer . We are the first and the pioneer in the Plastic Compounds and Masterbatches industry in Indonesia. We have been serving our customers well since we started our commercial production in early 1991.</p>\r\n<p>  We are focusing on the research and development to improve our current product ranges and developing new      products as well as developing environmental friendly products. We adhere to the Customers? needs for high quality products as well as the strict international quality standard, which was proven by the achievement in getting the ISO 9001 Certificate in April 1998. Our commitment to the QUALITY is further enhanced by the success of passing every six monthly EXTERNAL AUDIT done by SGS for the past 14 years. Our focus are meeting our Customers? needs and ensuring that all Customers get the benefits and advantages from our quality products and services.</p>\r\n<p>We are committed in making timely delivery to help our Customers minimize the inventory cost. Our services do not end at the product delivery point by providing after sales services, which is conducted by our experienced technical service personals. Our Technical Service personals have experiences and abilities to provide assistance to solve  Customers? problems in production process and in developing new product applications, as well as, providing information of our new developed grades to keep Customers well informed with the latest technological trends. Our technical service Personals are aware that the needs of the costumers deserve TOP PRIORITY and THE CUSTOMERS ARE OUR MOST VALUABLE BUSINESS ASSETS.</p>\r\n<p>With total investment of US $ 6,200,000 and capacity of 30.000 MT/year, it is our duty to supply good product with competitive price and also to give the best service to our   customer, we are quite willing to be judged by both the quality of the products we supply and the quality of our services to customers.</p>\r\n<p>After all, it is our company reputation at stake. We pledge that CUSTOMER SATISFACTION will remain our TOP PRIORITY. With the combination of our experience and outstanding personal resources which is backed up by our Laboratory and Quality Control equipment, we will be able to MAINTAIN OUR PRODUCTS QUALITY and to DEVELOP VARIOUS NEW PRODUCTS in line with the development in technology as well as the market need.<br />\r\n</p>', 'Jl. Industri Raya IV Blok AE/10;<br />\r\nCikupa, Tangerang,<br />\r\nIndonesia<br />', '311,313,314,315,318,326,365,366', 'Sales of Halim Sakti <br />\r\nTelp. (62-21) 5903992;<br />\r\nFax. (62-21) 5900268<br />\r\nE-mail : hasiu@centrin.net.id<br /><br />', 'hasiu_logo.gif', 'hasiu01.jpg', NULL, 'yes', 'PT. Halim Samudra Interutama'),
(3, 'PT SINAR PERMATA HALIM SWADAYA', 'Manufacturing various food additivessuch as:<br />\r\nRyoto Ester SP; food emulsifier / whipping agent for sponge cake using technology from Mitshubisi Kagaku Food Chemical.<br />\r\nBaking Powder<br />\r\nBlended Phosphate<br />\r\nJelly Powder<br />\r\nThese products has strong market share in the domestic market and Ryoto Ester SP has also been exported to several countries. PT SINAR PERMATA HALIM SWADAYA is not complacent with its achievement thus far and seeks to go further in producing world class products. The company is preparing to obtain the HACCP certification ISO 22000, a world renowned certification food quality in the food industry.<br /><br />', 'Jl. Rungkut Industri II/43 A <br />\r\nSurabaya 60239, <br />\r\nIndonesia <br />\r\nTelp. (62-31) 841 2562, 843 1636 <br />\r\nFax. (62-31) 841 3851 <br />\r\nE-mail : sphs@halim-sakti.com <br /> <br />', '155,153,207,158,189', 'Sales of PT Sinar Permata Halim Swadaya <br />\r\nTelp. (62-31) 841 2562, 843 1636 <br />\r\nFax. (62-31) 841 3851 <br />\r\nE-mail : sphs@halim-sakti.com <br /> <br />', 'sphs_logo.gif', 'sphs_pic.jpg', NULL, 'yes', 'PT. Sinar Permata Halim Swadaya'),
(4, 'PT PASTILANCAR MITRALANGGENG', 'Sea cargo forwarding agent having it\'s own fleet of tractor head to transport containerized cargo from seaport to costumer warehouse and vice versa for export and import activities.<br /><br />', 'Jl. Tomang Raya No. 4 <br />\nJakarta 11430, <br />\nIndonesia <br />\nTelp. (62-21) 5600400, 5660708 <br />\nFax. (62-21) 5600390, 5667440 <br />\nE-mail : pl@halim-sakti.com<br /><br />', '0', 'Sales <br />\nTelp. (62-21) 5600400, 5660708 <br />\nFax. (62-21) 5600390, 5667440 <br /><br />', 'pl_logo1.gif', 'pl_pic.jpg', NULL, 'no', NULL),
(5, 'PT HALIM SEJAHTERA CIPTA MANDIRI', 'Trading Company in various kinds of Specialty and Industrial Chemicals, covering Medan and surrounding areas.<br /><br />', 'Jl. Yose Rizal No. 1 EE <br />\nMedan 20214, <br />\nIndonesia <br />\nTelp. (62-61) 7345292, 7345293 <br />\nFax. (62-61) 7345287 <br />\nE-mail : hscm@halim-sakti.com <br /><br />', '374,375,376,377,378,379,380,381,382', 'Sales of PT HALIM SEJAHTERA CIPTA MANDIRI <br />\nTelp. (62-61) 7345292, 7345293 <br />\nFax. (62-61) 7345287 <br /> <br />', 'hscm_logo1.gif', 'hscm_pic.jpg', NULL, 'no', NULL),
(6, 'PT HALIM SARIGANDUM PRIMA', '<ul>\n<li>\nPT HALIM SARIGANDUM PRIMA  flour mill is one of the affiliated companies of PT HALIM SAKTI group; who is a supplier of industrial & specialty chemicals, food additives and plastic compounds.\n</li><br />\n\n<li>\nPT HALIM SARIGANDUM PRIMA  flour mill, occupying an area of 25000 m?, is the first factory to be established in Sumatera, Indonesia. The factory is strategically located in KIM II (Kawasan Industri Medan 2), which is 10 km away from Belawan International seaport. The construction of the factory started in February 2008 and started commercial production by November 2010 with capacity of 150 MT/day, and soon the capacity would be increased to 350 MT/day.    \n</li><br />\n\n<li>\nWith the establishment of the first commercialized flour mill factory in Sumatra, Indonesia; we hope to support customers in the North Sumatra region, especially in the food industries segment that use wheat flour as their main raw ingredients, such as noodles, breads, biscuits, snacks and other traditional foods.\n</li><br />\n\n\n<li>\nSince PT HALIM SARIGANDUM PRIMA  flour mill has an advance technology in wheat flour production, we are able to produce wheat flour with high quality. Furthermore, with our production facility located in North Sumatera, we are able to serve our customers with fresher products, more competitive price, and shorter lead time, which result in better competitive advantages for our customers in terms of stock efficiency  and stable supply.\n</li><br />\n\n<li>\nStock efficiency and stable supply will help our wheat flour based food industry food costumers to increase competitiveness in terms of better product quality and faster inventory turnover.\n</li><br />\n\n<li>\nWith the principal of Total Quality Commitment, Honesty and Responsibility, PT HALIM SARIGANDUM PRIMA  flour mill is looking forward to grow mutually together with all of our customers. </li>\n</ul>\n<br />', 'Jl. Pulau Nias Selatan <br/>\n(Simpang Jl. Pulau Tanah Masa)<br/>\nKim II. Deli Serdang, <br/>\nSumatera Utara <br/>\nTelp. (62-61) 6871889 <br/> \nE-mail: hsgp@halim-sakti.com <br/><br />', '368,369,370,371', 'Sales of PT HALIM SARIGANDUM PRIMA <br/>\nTelp. (62-61) 6871889 <br/>\nemail: hsgp@halim-sakti.com <br/> <br/>', '0', 'foto_hsgp.jpg', NULL, 'yes', 'PT. Halim SariGandum Prima');
