INSERT INTO `highlights` (`highlights_id`, `highlights_desc`, `highlights_pic`, `highlights_product`, `highlights_pic2`, `highlights_product2`) VALUES
(1, 'PT HALIM SAKTI PRATAMA is the headquarter office of HALIM SAKTI GROUP companies \nsupplying specialty and industrial chemical in Indonesia for more than 35 years. \n<br />\n<br />\nLocated in Western part of Jakarta, the capital city of Indonesia, \nthis company was established in 1972 by Mr. Jusuf Halim under the\nname of PD Halim (Sole trading company) and in 1976 was reorganized \nand registered as private limited company with the name PT HALIM SAKTI.\n<br />', 'home-banner1_awal11.jpg', '153,155,158,189,207,368,369,370,371', 'highlight-pic1.jpg', '311,313,314,315,318,326,365,366,367');
INSERT INTO `news` (`id_news`, `image`, `news_nama`, `news_nama_slug`, `news_nama_eng`, `news_nama_eng_slug`, `description`, `description_eng`, `description_sub`, `description_sub_eng`, `created_at`, `updated_at`) VALUES
(1, '1657513484_spray.png', 'SPRAY FAT MP-3 by Riken Vitamin', 'spray-fat-mp-3-by-riken-vitamin', 'SPRAY FAT MP-3 by Riken Vitamin', 'spray-fat-mp-3-by-riken-vitamin', '<p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Makanan yang digoreng saat ini sangat umum di masyarakat. Kualitas makanan yang digoreng bergantung pada visual, tekstur, dan sensori. Penurunan kerenyahan pada produk makanan yang digoreng dapat terjadi karena penyerapan uap air dari lingkungan atau perpindahan air dari produk ke coating produk tersebut.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Prinsip pemberian coating sebelum proses pemasakan sudah ada sejak lama. Proses coating memiliki peran penting dalam memaksimalkan yield produk, serta mempengaruhi pelepasan rasa (flavor), tekstur dan penampilan visual. Coating yang berkualitas dapat membuat rasa, tekstur, penampilan, serta mouthfeel pada makanan menjadi lebih baik. Pemilihan adonan, breading, ataupun coating yang tepat dapat membuat makanan yang unik, menggugah selera dan akan selalu menjadi favorit konsumen serta memiliki masa penyimpanan (shelf life) produk yang lebih baik.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Saat ini, tingkat permintaan konsumen terhadap makanan yang digoreng meningkat dibandingkan dengan sebelumnya. Untuk dapat masuk ke market coating, diperlukan sebuah produk dengan sistem coating yang dapat menyediakan tekstur dan penampilan yang baik. Dilihat dari trend yang sudah ada, permintaan konsumen untuk makanan praktis dan produk food service yang digoreng namun berkualitas akan semakin meningkat.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">Riken Vitamin\'s Spray Fat MP-3 akan membantu Anda mengatasi tantangan dalam produk yang digoreng :</span></p><ul style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\"><li>Mengkontrol kelembapan saat proses penggorengan untuk mendapatkan tekstur yang sempurna</li><li>Mempertahankan kerenyahan untuk waktu yang lebih lama</li></ul><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">Riken Vitamin\'s Spray Fat MP-3 :</span></p><ul style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\"><li>Lemak dengan titik leleh tinggi berbentuk bubuk halus</li><li>Meningkatkan kerenyahan dan firmness &nbsp;dari batter coating</li><li>Mempertahankan tekstur agar seperti tekstur baru digoreng</li></ul><p><span style=\"font-weight: bolder; color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Analisa Tekstur dari Batter menggunakan Texture Analyzer :</span></p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Saat dilakukan analisa batter menggunakan texture analyzer, dapat dilihat produk yang memiliki puncak yang lebih tinggi dan drop yang lebih besar menunjukkan tekstur renyah yang enak.<br>Penjelasan grafik:</p><ul style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\"><li>MP-3 awal : Puncak yang tinggi dan penurunan yang besar</li><li>MP-3 5h : Puncak agak sedikit menurun tetapi masih mengalami penurunan yang cukup besar</li><li>Blanko awal : Puncak cukup tinggi dan penurunan sedang</li><li>Blanko 5h : Puncak menurun dan tidak ada penurunan</li></ul><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Jika tidak terjadi &nbsp;penurunan / penurun yang terjadi kecil dapat disimpulkan tekstur batter lembek atau kenyal.</p><p><br></p>', '<p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Fried foods today are so common, and it all comes down to the visual, texture, and sensory experience when differentiating quality fried foods.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">The concept of covering a basic food product with some sort of coating before cooking has been around for a long period of Time. A quality coating plays an important role in maximising product yields, while delivering flavour as well as textural and visual differences.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\"><br></p>', '<span style=\"font-family: Roboto, sans-serif;\">Makanan yang digoreng saat ini sangat umum di masyarakat. Kualitas makanan yang digoreng bergantu...</span>', '<span style=\"font-family: Roboto, sans-serif;\">The global market for snacks according to Mintel Market Data (December,2020) shows an increasing ...</span>', '2022-07-10 21:24:47', '2022-07-11 01:04:30'),
(2, '1657517526_protein-bar.png', 'Tren & Perkembangan Produk Bar Protein', 'tren-perkembangan-produk-bar-protein', 'Protein Bar Product Trends and Development', 'protein-bar-product-trends-and-development', '<p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Pasar global untuk makanan &nbsp;ringan (snack) menurut Data Pasar Mintel (Desember,2020) menunjukkan tren positif yang meningkat dengan nilai 174 miliar dollar AS pada 2019 serta memiliki tingkat pertumbuhan tahunan rata-rata (CAGR) sebesar 3,9% hingga 2023 mendatang. Di tingkat volume, Tiongkok menduduki tingkat pertama penjualan produk makanan ringan yang disusul dengan Amerika Serikat, India, Jepang, dan Meksiko.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Konsumsi makanan ringan saat ini juga mengalami pergeseran dari fitrah awalnya sebagai makanan selingan. Kini produk makanan ringan menjadi fleksibel dapat dinikmati kapan pun. Ekspektasi terhadap makanan ringan juga mengalami perubahan dimana sebanyak 54% konsumen global mengatakan makanan ringan dapat membantu kebutuhan gizi yang diperlukan. “Tidak mengejutkan melihat perubahan ini, kesadaran akan hidup yang lebih sehat juga mendorong 51% konsumen global menukar konsumsi makanan ringan ‘tradisional’ mereka seperti cokelat dan konfeksionari dengan makanan ringan yang memiliki kandungan tinggi protein atau rendah gula,” jelas Senior Director, Product Strategic Management Glanbia Nutritionals, Brad Meyers dalam Live Webcast-Raise the bar : Rise of high-protein bars in Asia yang diselenggarakan oleh Buhler dan Glanbia Nutritionals pada 21 Januari 2021 lalu.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">Persepsi Kesehatan dan Protein</span></p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Sebuah survei yang dilakukan oleh Health Focus International (Mei, 2019), menunjukkan bahwa konsumen (pembeli produk) di seluruh dunia lebih mementingkan proses pengurangan atau menjauhi produk-produk dengan penggunaan pemanis buatan, mengurangi konsumsi gula, dan menambah atau memperbanyak konsumsi serat, biji-bijian utuh, serta protein dalam pola konsumsi mereka saat ini. Keinginan untuk mengkonsumsi produk tinggi protein ini juga terus meningkat selama periode tahun 2005-2019.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Sebanyak 41% konsumen menginginkan ada kandungan protein dalam pola konsumsi mereka. Protein menjadi komponen yang penting karena manfaatnya yang sangat luas pada berbagai aspek. Protein menyumbang manfaat pada berbagai aspek fisik seperti Kesehatan tulang, mendukung kesehatan rambut, kulit dan kuku. Di aspek lain seperti aspek mental, protein juga bermanfaat untuk membantu menyuplai gizi pada otak dan energi untuk mental.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">“Dengan segudang manfaat tersebut, 70% responden pada suatu survey mengatakan bahwa jika makanan ringan memiliki kategori dengan penambahan protein lebih banyak, maka mereka akan segera mengategorikan produk terseut sebagai produk yang lebih menyehatkan,” tambah Meyers. Secara spesifik, makanan ringan berupa bar protein juga mengalami pertumbuhan yang cepat dibandingkan dengan jenis bar lainnya. “Saat ini, bar merupakan bentuk makanan ringan yang sangat dipilih karena karakteristiknya yang memiliki masa simpan stabil, fleksibel untuk dikonsumsi serta makanan ringan dengan kandungan tinggi protein,” lanjut Meyers.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Bar protein tumbuh sebesar 37% dari total produk bar di pasar Amerika Serikat. Tingkat kandungan protein pada produk bar di Amerika terbagi menjadi tiga kategori segmentasi yakni di tingkat kurang dari 10%, 10-19%, serta lebih dari 20%. Pertumbuhan paling cepat dimiliki oleh produk bar dengan kandungan lebih dari 10%.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Di Asia Pasifik, konsumsi bar tinggi protein ini juga tidak kalah menariknya dengan Amerika Serikat. Hampir 1/3 dari makanan ringan yang dirilis di wilayah Asia Pasifik tahun lalu, memiliki karakteristik dengan klaim penambahan/tinggi protein. Data Mintel juga menunjukkan bahwa selain penambahan/tinggi protein, klaim lain yang diminati oleh konsumen Asia Pasifik adalah vegan, dengan penambahan/tinggi serat, rendah/pengurangan gula, serta klaim fungsional untuk Kesehatan pencernaan.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">Pertimbangan Formulasi Produk Bar Protein</span></p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Merancang formulasi produk bar tinggi protein merupakan pekerjaan yang menantang sekaligus penuh dengan pertimbangan. Research Manager, Asia Pasific Glanbia Nutritionals, He Xiayou dalam kesempatan yang sama menuturkan bahwa untuk membuat sebuah bar yang baik diperlukan keseimbangan di seluruh aspek terkait. Aspek tersebut adalah cita rasa yang meliputi tingkat kekerasan, kemudahan dipotong, mouthfeel, kelembapan, kerenyahan, flavor hingga tipe produk bar.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Aspek lainnya yakni zat gizi di mana termasuk komponen protein, lemak, sirup, serat, pelapis, hingga vitamin dan mineral. Tidak lupa, aspek berikutnya yakni masa simpan yang meliputi proses pencokelatan hingga aktivitas air. “Paling penting dan mendasar adalah mengetahui preferensi konsumen terhadap produk bar yang diinginkan. Setelah itu, baru diformulasikan dengan tingkat keseimbangan, sesuai sehingga didapatkan produk akhir yang memenuhi seluruh aspek yang diinginkan,” tutur Xiayou.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Setiap bahan atau ingridien yang dipakai akan memiliki sifatnya masing-masing, pun termasuk protein, untuk itu pemahaman akan pengetahuan bahan juga sangat penting karena mempengaruhi profil dari produk akhir yang akan diproduksi.&nbsp;</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Sumber : FoodReview Indonesia Vol XVI<br></p>', '<p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">The global market for snacks according to Mintel Market Data (December,2020) shows an increasing positive trend with a value of 174 billion US dollars in 2019 and has an average annual growth rate (CAGR) of 3,9% until 2023. At the volume level, China occupies the first rank of sales of snack food products, followed by the United States, India, Japan and Mexico.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">The consumption of snacks is currently experiencing a shift from its initial nature as a snack. Now flexible snack products can be enjoyed at any time. Expectations for snacks have also changed where as many as 54% of global consumers say snacks can support their nutritional needs. \"Not surprisingly seeing this change, awareness of a healthier life is also driving 51% of global consumers to swap their consumption of \'traditional\' snacks like chocolate and confectionery for snacks that are high in protein or low in sugar,\" explained Senior Director, Product Strategic Management Glanbia Nutritional, Brad Meyers in Live Webcast-Raise the bar: Rise of high-protein bars in Asia held by Buhler and Glanbia Nutritional on January 21, 2021.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">Perceptions of Health and protein</span></p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">A survey conducted by Health Focus International (May, 2019), shows that consumers around the world are more concerned with reducing or staying away from products with artificial sweeteners, reducing sugar consumption, and increasing or increasing consumption. Fiber, whole grains, and protein in their current diet. The desire to consume high protein products has also continued to increase during the period 2005-2019.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">As many as 41% of consumers want protein content in their consumption patterns. Protein is an important component because of its very broad benefits in various aspects. Protein contributes benefits to various physical aspects such as bone health, supports hair, skin and nail health. In other aspects such as mental aspects, protein is also useful to help supply nutrition to the brain and energy for mental.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">\"With a myriad of benefits, 70% of respondents to a survey said that if snacks have a category with more protein added, they will immediately categorize the product as healthier,\" added Meyers. Specifically, protein bar snacks are also experiencing rapid growth compared to other types of bars. \"Currently, bars are the preferred form of snack food because of their characteristics which have a stable shelf life, are flexible for consumption and snacks with high protein content,\" continued Meyers.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Protein bars grew by 37% of total bar products in the United States market. The level of protein content in bar products in America is divided into three segmentation categories, namely at levels less than 10%, 10-19%, and more than 20%. Bar products have the fastest growth with a content of more than 10%.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">In Asia Pacific, consumption of high-protein bars is no less attractive than the United States. Nearly 1/3 of the snacks released in the Asia Pacific region last year had characteristics with high protein / additive claims. Mintel\'s data also show that apart from add / high protein, another claim that Asia Pacific consumers are passionate about is vegan, with added / high fiber, low / reduced sugar, as well as functional claims for digestive health.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">Protein bar product formulation considerations</span></p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Designing a high protein bar product formulation is both challenging and considerate. Research Manager, Asia Pacific Glanbia Nutritional, He Xiayou, on the same occasion said that to create a good bar, it is necessary to create a good bar, a balance is needed in all related aspects. These aspects are the taste which includes the level of hardness, cut ease, mouthfeel, moisture, crunchiness, flavour to the type of bar product.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Another aspect is nutrition which includes components of protein, fat, syrup, fiber, coatings, to vitamins and minerals. Do not forget, the next aspect is the shelf life which includes the browning process to water activities. \"The most important and basic is knowing consumer preferences for the desired bar product. After that, it is only formulated with a balanced level, so that a final product is obtained that fulfil all the desired aspects, \"said Xiayou. Each ingredient or ingredient used will have its own properties, including protein, therefore understanding material knowledge is also very important because it affects the profile of the final product to be produced</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Source : FoodReview Indonesia Vol XVI<br></p>', '<span style=\"font-family: Roboto, sans-serif;\">Pasar global untuk makanan ringan (snack) menurut Data Pasar Mintel (Desember,2020) menunjukkan ...</span>', '<span style=\"font-family: Roboto, sans-serif;\">The global market for snacks according to Mintel Market Data (December,2020) shows an increasing ...</span>', '2022-07-10 22:32:06', '2022-07-19 01:47:12'),
(3, '1657519534_prepared-drinking.png', 'Industri Minuman Siap Saji : Tantangan dan Kesempatan Pasca Pandemi Covid-19', 'industri-minuman-siap-saji-tantangan-dan-kesempatan-pasca-pandemi-covid-19', 'Prepared-Drinking Challenges and Opportunities Post Pandemic Covid-19', 'prepared-drinking-challenges-and-opportunities-post-pandemic-covid-19', '<p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Sektor ini mencakup berbagai kategori minuman seperti Air Minum Dalam Kemasan (AMDK – kemasan botol dan cup), the siap saji, minuman jus dan sari buah, minuman berkarbonasi, minuman kopi, minuman sport dan isotonik serta juga minuman berbasis susu, dan semua ini semata-mata guna menjawab kebutuhan konsumen Indonesia yang memang beragam, baik dari sisi preferensi produk minuman, kebutuhan produk, kebiasaan dan juga tentunya kemampuan untuk berbelanja produk minuman siap saji. Kategori-kategori tersebut sifatnya cukup dinamis ke depannya karena preferensi dan kemampuan konsumen akan terus berkembang.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Satu hal yang dapat dibanggakan adalah produk-produk minuman siap saji yang diproduksi di Indonesia relative sudah menjadi tuan rumah di negeri sendiri. Terlihat bagaimana produk-produk minuman yang ditawarkan oleh produsen dalam negeri, apakah merek lokal ataupun produsen asing yang mengeluarkan produk varian lokal, tersedia di berbagai minimarket, supermarket, hypermarket serta di warung-warung dan toko-toko kelontong.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Dapat dikatakan industry minuman siap saji mempunyai karakter yang cukup demokratis dimana pelaku usaha dari berbagai latar belakang dan kemampuan dapat bersaing guna meraih penerimaan pasar atau konsumen. Data Badan Pusat Statistik (BPS) tahun 2015 menyebutkan bahwa terdapat lebih dari 47000 pelaku usaha skala kecil dan mikro di sektor industri minuman. Sedangkan perusahaan menengah dan besar berada di kisaran 300 perusahaan.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">Tantangan Industri Minuman</span></p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Industri minuman siap saji sangat mengandalkan keberadaan hotel, restoran, catering, serta kegiatan-kegiatan berkumpulnya masyarakat, sebagai pasarpotensial bagi produk-produknya. Pandemi Covid-19 menghantam industri minuman siap saji secara tiba-tiba sejak Maret 2020, sehingga pondasi industri minuman siap saji menjadi porak-poranda. Secara umum ada dua dampak besar yang dirasakan oleh industri minuman siap saji akibat pandemic Covid-19. Pertama adalah kanal pemasaran (market channel) produk minuman siap saji dan kedua adalah kategori produk dan portfolio produk minuman siap saji.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Secara historis, kanal tradisional atau penjualan umum seperti warung-warung maupun toko-toko kelontong selalu mendominasi kanal pemasaran produk minuman siap saji di Indonesia. Hal ini karena memang keberadaan warung-warung serta toko-toko kelontong sangat massif dan tersebar sehingga wajar kontribusi penjualan produk minuman siap saji melalui kanal ini bisa mencapai 60%-70% dari seluruh volume penjualan.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Pertumbuhan penjualan produk minuman siap saji melalui kanal pasar modern seperti minimarket, convenience stores, supermarket, hypermarket, dan lainnya memang cukup pesat di beberapa tahun terakhir. Berdasarkan data Nielsen tahun 2019, pertumbuhan penjualan minuman siap saji di pasar modern mencapai kurang lebih 6%, sementara pertumbuhan di kanal tradisional malah negative di kisaran 2-3%.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Namun pandemic Covid-19 merubah tatanan yang ada. Dengan adanya pembatasan pergerakan manusia serta adanya kekhawatiran tentang isu Kesehatan dan hygiene, konsumen menjadi beralih. Kanal perdagangan niaga (e-commerce) yang sebelumnya belum terlalu berperan, saat ini banyak menjadi pilihan konsumen untuk berbelanja kebutuhan sehari-hari juga kebutuhan makanan dan minuman siap saji.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Walaupun di awal-awal masa pandemic, kanal modern seperti minimarket sempat turut mengalami penurunan penjualan, namun dengan berjalannya waktu, konsumen mulai Kembali belanja di minimarket, terutama didorong kedekatan dengan lokasi tinggal dan tingkat kepercayaan yang diterapkan serta protocol Kesehatan di minimarket tersebut. Tantangan terbesar adalah pada kanal tradisional seperti warung-warung dan toko-toko kelontong yang mengalami penurunan omset secara signifikan.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Berkurangnya foot traffic dan adanya kekhawatiran terhadap penerapan protokol kesehatan menjadi isu yang besar bagi warung-warung dan toko-toko kelontong. Tidak heran terlihat beberapa inisiatif yang dilakukan pelaku usaha fast moving consumer goods (FCMG) dan/atau minuman siap saji yang bertujuan mendukung toko-toko kelontong untuk bisa menerapkan protocol Kesehatan yang baik dan tentunya dengan harapan toko-toko kelontong tersebut dapat Kembali mengalami pertumbuhan.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Dampak pandemic Covid-19 tidak hanya terasa dalam sisi aktivitas masyarakat yang sangat menurun, tetapi juga bagaimana masyarakat atau konsumen berbelanja baik dari sisi apa yang dibeli dan juga kenapa berbelanja produk-produk tersebut. Dengan semakin banyaknya waktu yang dihabiskan di rumah, konsumen produk minuman siap saji juga mengalami perubahan pola konsumsi.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">Kesempatan Industri Minuman</span></p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Minuman siap saji secara prinsip bukan merupakan produk primer, sehingga pada saat konsumen dihadapkan dengan kondisi dimana mereka harus memilih, produk minuman siap saji dapat dengan mudah ditinggalkan dan digantikan dengan produk minuman lainnya. Ini terkihat di masa-masa awal pandemic saat produk minuman siap saji single serve (sekali konsumsi) mengalami penurunan. Sementara sebaliknya produk minuman siap saji dengan kemasan multi serve didorong penjualannya dengan harapan dapat dikonsumsi secara Bersama-sama oleh keluarga dalam kondisi harus beraktivitas di rumah. Hal tersebut adalah contoh cara yang dilakukan oleh pelaku usaha industry minuman siap saji guna memastikan bahwa produk yang ditawarkan &nbsp;masih relevan dengan pola konsumsi konsumen yang berubah.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Hal lain yang dapat dicermati terkait dengan perubahan pola konsumsi adalah kategori produk minuman siap saji yang dipilih oleh konsumen. Secara umum semua kategori produk minuman siap saji mengalami kontraksi penjualan yang cukup signifikan dalam masa pandemi ini. Namun tentunya level kontraksi per kategori mempunyai perbedaan.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Kepedulian konsumen terkait dengan isu ketahanan tubuh untuk melawan potensi penyebaran COVID-19 sedikit banyak juga memengaruhi pola konsumsi produk minuman siap saji. Produk-produk yang dipercaya memiliki manfaat fungsional menjaga dan meningkatkan ketahanan tubuh saat ini menjadi pilihan dan terlihat pula bagaimana komunikasi yang kencang dilakukan oleh produsen untuk menampilkan manfaat fungsional tersebut.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Walaupun industri minuman siap saji mengalami dampak yang sangat signifikan diakibatkan pandemik ini, namun di sisi lain dapat terlihat resiliensi atau ketahanan dari para pelaku usaha industri minuman untuk keluar dari kondisi yang ada. Berbagi upaya dan kreativitas diambil guna memastikan industry tetap beroperasi dan segera bisa tumbuh Kembali. Di lain pihak pembelajaran yang utama adalah bagaimana perubahan pola konsumsi dan preferensi konsumen ini berdampak di jangka memengah dan Panjang, bahkan setelah pandemic Covid-19 ini berakhir.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Diyakini bahwa opsi pola kerja secara remote akan terus ada dan bisa menjadi bagian dari pola kerja yang baru di masa depan. Demkian pula kegiatan kegiatan yang sifatnya mengumpulkan massa secara secara besar dalam waktu dekat mungkin belum akan terjadi. Artinya, produsen harus bisa untuk lebih mendekatkan produk ke konsumen tidak saja secara distribusi tetapi juga dari sisi “reason to purcahase”.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Di saat seperti inilah dukungan semua pihak, termasuk pemerintah sangat diharapkan agar dapat membantu industry minuman siap saji bangkit dari kondisi yang sulit dan bahkan tumbuh kembali. Dukungan terutama terkait dengan dua aspek yang tidak semuanya dalam kontrol pelaku usaha yaitu bagaimana menjaga daya beli konsumen dan bagaimana mengurangi beban bagi industri, misal dari sisi kepastian pasokan bahan baku dan juga biaya. Ibarat strategi bermain, “defense” yang kuat dalam hal ini menjaga daya beli konsumen dan mengurangi beban produsen akan memberikan kesempatan bagi “offense” untuk dapat maju dan merebut peluang untuk bangkit dan tumbuh. Inilah sinergi yang diharapkan dapat direalisasikan agar industry minuman siap saji dapat terus menjadi tuan rumah di negeri sendiri. Bangkit dan jayalah industri minuman siap saji Indonesia.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">&nbsp;Source : FOODREVIEW INDONESIA Vol XVI No. 2</p>', '<p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">This sector covers various beverage categories such as Bottled Drinking Water (RTD- bottled and cup), ready-to-serve tea, juice and fruit juice drinks, carbonated drinks, coffee drinks, beverages sport and isotonic as well as milk-based drinks, and all of this is solely to answer the diverse needs of Indonesian consumers, both in terms of beverage product preferences, product needs, habits and of course the ability to shop for ready-to-drink beverage products. These categories are quite dynamic in the future because consumer preferences and abilities will continue to evolve.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">One thing that can be proud of is that ready-to-eat beverage products produced in Indonesia have relatively become the host in their own country. It can be seen how the beverage products offered by domestic producers, whether local brands or foreign producers that issue local variant products, are available in various minimarkets, supermarkets, hypermarkets as well as in stalls and grocery stores.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">It can be said that the ready-to-serve beverage industry has a fairly democratic character where business actors from various backgrounds and abilities can compete in order to gain market or consumer acceptance. Data from the Central Statistics Agency (BPS) in 2015 stated that there were more than 47000 small and micro-scale business actors in the beverage industry sector. Meanwhile, medium and large companies are in the range of 300 companies.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">Challenges of the Beverage</span></p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Industry The ready-to-serve beverage industry relies heavily on the existence of hotels, restaurants, catering, and community gathering activities, as potential markets for its products. &nbsp;The Covid-19 pandemic has hit the ready-to-serve beverage industry suddenly since March 2020, so that the foundations of the ready-to-drink industry are in ruins. In general, there are two major impacts felt by the ready-to-serve beverage industry due to the Covid-19 pandemic. First is the marketing channel (market channel) of ready-to-serve beverage products and the second is the product category and ready-to-drink product portfolio.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Historically, traditional channels or public sales such as stalls and grocery stores have always dominated the marketing channels for ready-to-serve beverage products in Indonesia. This is because the existence of stalls and grocery stores is very massive and spread out, so it is natural that the sales contribution of ready-to-drink products through this channel can reach 60-70 percent of the total sales volume.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">The sales growth of ready-to-serve beverage products through modern market channels such as minimarkets, convenience stores, supermarkets, hypermarkets, and others has indeed grown quite rapidly in recent years. Based on Nielsen\'s data for 2019, sales growth of ready-to-serve drinks in the modern market reached approximately 6%, while growth in traditional channels was negative at around 2-3%.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">However, the Covid-19 pandemic changed the existing order. With restrictions on human movement and concerns about health and issues hygiene, consumers are turning away. Channels of commercial trade (e-commerce), which previously has not been play a big role, this time a lot of the choice of consumers to for shop needs their daily also needs food and drink ready.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Even though in the early of days the pandemic, modern channels such as minimarkets experienced a decline in sales, but over time, consumers started shopping again at minimarkets, mainly due to the proximity to the location of residence and the level of trust that was applied as well as the health protocol in the minimarket. The biggest challenge is traditional canals such as grocery stores, which have experienced a significant decline in turnover.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Reduced foot traffic and concerns about implementing the Health protocol are big issues for stalls and grocery stores. It is not surprising that there are several initiatives carried out by fast moving consumer goods (FCMG) and / or ready-to-drink beverage businesses aimed at supporting grocery stores to be able to implement good health protocols and of course with the hope that these grocery stores can again experience growth.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">The impact of the Covid-19 pandemic is not only felt in the side of community activities that have decreased significantly, but also how people or consumers shop both in terms of what they buy and also why they shop for these products. With more time spent at home, consumers of ready-to-drink beverage products also experience changes in patterns consumption.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\"><span style=\"font-weight: bolder;\">Opportunity for the Industry Beverage</span></p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Ready-to-serve drinks are in not principle a primary product, so that when consumers are faced with a condition where they have to choose, ready-to-serve beverage products can easily be abandoned and replaced with other beverage products. This was seen in the early days of the pandemic when ready-to-serve single serve beverage products decreased. While on the other hand, ready-to-serve beverage products with multi serve packaging are encouraged by sales in the hope that they can be consumed together by the family while having activities at home. This is an example of the ways in which ready-to-eat beverage industry entrepreneurs ensure that the products offered are still relevant to changing consumer consumption patterns.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Another thing that can be observed in relation to changes in consumption patterns is the category of ready-to-drink products selected by consumers. In general, all categories of ready-to-serve beverage products experienced a significant contraction in sales during this pandemic. But the level of contraction per category has a difference.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Consumer concern related to the issue of body resistance to fight the potential spread of COVID-19 has more or less affected consumption patterns of ready-to-drink beverage products. Products that are believed to have functional benefits to maintain and increase body endurance are now an option and it can also be seen how strong communication is made by manufacturers to show these functional benefits.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Although the ready-to-serve beverage industry experienced a very significant impact due to this pandemic, on the other hand, it can be seen that the resilience or resistance of the beverage industry business actors to get out of the existing conditions. Sharing efforts and creativity are taken to ensure the industry continues to operate and can grow back soon. On the other hand, the main lesson is how these changes in consumption patterns and consumer preferences have an impact in the medium and long term, even after the Covid-19 pandemic ends.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">It is believed that the option of remote working patterns will continue to exist and could become part of new work patterns in the future. Likewise, activities that are generally mass-gathering in the near future may not take place. This means that producers must be able to get closer to the product to consumers, not only in a distributional manner but also from the \"reason to purchase\" side.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">At times like this, the support of all parties, including the government, is expected to be able to help the ready-to-serve beverage industry rise from difficult conditions and even grow back. Support is mainly related to two aspects that are not all under the control of business actors, namely how to maintain consumer purchasing power and how to reduce the burden on the industry in terms mass of certainty of raw material supply and costs. Like a playing strategy, a strong \"defense\" in this case maintains consumer purchasing power and reduces the burden on producers will provide an opportunity for \"offense\" to advance and seize opportunities to rise and grow. This is the synergy that is expected to be realized so that the ready-to-serve beverage industry can continue to host in its own country. Rise up and live the fast-food industry in Indonesia.</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Source : FOODREVIEW INDONESIA Vol XVI No. 2</p>', '<span style=\"font-family: Roboto, sans-serif;\">Sektor ini mencakup berbagai kategori minuman seperti Air Minum Dalam Kemasan (AMDK – kemasan bot...</span><br>', '<span style=\"font-family: Roboto, sans-serif;\">This sector covers various beverage categories such as Bottled Drinking Water (RTD- bottled and c...</span>', '2022-07-10 23:05:35', '2022-07-19 01:45:38'),
(4, '1657519872_adk-stab.png', 'ADK STAB LA-402AF/Si untuk aplikasi otomotif oleh ADEKA Corporation', 'adk-stab-la-402afsi-untuk-aplikasi-otomotif-oleh-adeka-corporation', 'ADK STAB LA-402AF/Si for automotive applications by ADEKA Corporation', 'adk-stab-la-402afsi-for-automotive-applications-by-adeka-corporation', '<p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">When the polymer material is used outdoors, it is oxidatively deteriorated by ultraviolet rays, which causes poor appearance and reduction of physical properties. Photo-oxidation deterioration of the polymer material can be suppressed by adding a small amount of light stabilizer such as ultraviolet absorption (UVA) or hindered amine-based light stabilizer (HALS).</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">Automotive materials are required to retain their appearance and physical characteristics for a long term, and HALS is commonly used to provide the necessary light stability. ADK STAB LA-402AF/Si is a HALS which shows significant long term weatherability for PP articles such as automotive application. The gloss and color stability of PP with ADK STAB LA-402AF are maintained for a longer period than with market reference such as LA77Y* (Graph 1 and 2).</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\">*Decanedioic acid, bis(2,2,6,6-tetramethyl-4-piperidinyl) ester</p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px; text-align: justify;\">In addition, it is particularly suitable for automotive interior applications made of thermoplastic elastomers such as TPV, showing excellent performance with respect to NOx discoloration and fogging resistance, which are both considered essential for these applications. (Graph 3).</p><div><span style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px; text-align: justify;\">ADK STAB LA-402AF showed better blooming-out resistance compared to LA-77Y and equal to formulation w/o HALS(Graph 4). In addition, ADK STAB LA-402AF shows excellent fogging behavior in formulations of automotive application submitted to a DIN 75201 testing procedure. This is due to its high compatibility with PP/TPE polymers.</span></div><div><span style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px; text-align: justify;\"><br></span><br></div>', '<p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\"><font style=\"vertical-align: inherit;\"><font style=\"vertical-align: inherit;\">Ketika bahan polimer digunakan di luar ruangan, itu secara oksidatif memburuk oleh sinar ultraviolet, yang menyebabkan penampilan yang buruk dan pengurangan sifat fisik.&nbsp;</font><font class=\"\" style=\"vertical-align: inherit;\">Deteriorasi foto-oksidasi bahan polimer dapat ditekan dengan menambahkan sejumlah kecil penstabil cahaya seperti penyerapan ultraviolet (UVA) atau penstabil cahaya berbasis amina terhalang (HALS).</font></font></p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\"><font style=\"vertical-align: inherit;\"><font style=\"vertical-align: inherit;\">Bahan otomotif diperlukan untuk mempertahankan penampilan dan karakteristik fisiknya untuk jangka panjang, dan HALS biasanya digunakan untuk memberikan stabilitas cahaya yang diperlukan.&nbsp;</font><font style=\"vertical-align: inherit;\">ADK STAB LA-402AF/Si adalah HALS yang menunjukkan ketahanan cuaca jangka panjang yang signifikan untuk barang-barang PP seperti aplikasi otomotif.&nbsp;</font><font style=\"vertical-align: inherit;\">Stabilitas kilap dan warna PP dengan ADK STAB LA-402AF dipertahankan untuk periode yang lebih lama dibandingkan dengan referensi pasar seperti LA77Y* (Grafik 1 dan 2).</font></font></p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\"><font style=\"vertical-align: inherit;\">* Asam dekanadioat, bis(2,2,6,6-tetrametil-4-piperidinil) ester</font></p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\"><font style=\"vertical-align: inherit;\"><font style=\"text-align: justify; vertical-align: inherit;\">Selain itu, sangat cocok untuk aplikasi interior otomotif yang terbuat dari elastomer termoplastik seperti TPV, menunjukkan kinerja yang sangat baik sehubungan dengan perubahan warna NOx dan ketahanan fogging, yang keduanya dianggap penting untuk aplikasi ini.&nbsp;</font><font style=\"text-align: justify; vertical-align: inherit;\">(Grafik 3).</font></font></p><p style=\"color: rgb(99, 99, 99); font-family: Roboto, sans-serif; font-size: 18px;\"><font style=\"vertical-align: inherit;\"><font style=\"text-align: justify; vertical-align: inherit;\"><font style=\"vertical-align: inherit;\">ADK STAB LA-402AF menunjukkan ketahanan blooming-out yang lebih baik dibandingkan dengan LA-77Y dan sama dengan formulasi tanpa HALS (Grafik 4).&nbsp;</font><font style=\"vertical-align: inherit;\">Selain itu, ADK STAB LA-402AF menunjukkan perilaku fogging yang sangat baik dalam formulasi aplikasi otomotif yang diajukan ke prosedur pengujian DIN 75201.&nbsp;</font><font style=\"vertical-align: inherit;\">Ini karena kompatibilitasnya yang tinggi dengan polimer PP/TPE.</font><br></font><br></font></p>', '<span style=\"font-family: Roboto, sans-serif; background-color: rgb(239, 239, 239);\">Ketika bahan polimer digunakan di luar ruangan, itu secara oksidatif memburuk oleh sinar ultraviolet, ...</span>', '<span style=\"font-family: Roboto, sans-serif; background-color: rgb(239, 239, 239);\">When the polymer material is used outdoors, it is oxidatively deteriorated by ultraviolet rays, w...</span>', '2022-07-10 23:11:12', '2022-07-10 23:11:12');
