(1, '1657094391_other-general-g.jpg', 'Other General Chemical Products', 'Other General Chemical Products', 'other-general-chemical-products', 'Selain bahan kimia yang spesifik digunakan di industri tertentu, kami juga menyediakan berbagai produk kimia umum yang dapat digunakan oleh berbagai industri. Dengan koleksi produk kami yang luas, kami dapat menyediakan bahan kimia untuk berbagai aplikasi mulai dari pewarna dan pengolah air hingga aditif makanan dan pakan.', 'In addition to chemicals specialized for specific industries, we also provide various general chemical products that can be used by various industries. With our extensive collection of products, we provide chemicals for a wide range of applications from dyes and water treatment to food and feed additives.', '<p style=\"font-family: Roboto, sans-serif;\">Berbagai macam bahan kimia untuk keperluan umum</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Acetic Acid</li><li>Ammonium Chloride</li><li>Ammonia Liquid</li><li>Calcium Carbonate</li><li>Calcium Choride</li><li>Calcium Hypochlorite 65 % &amp; 70 %</li><li>Caustic Soda</li><li>Copper Sulphate</li><li>Disodium Phosphate</li><li>Ferric Chloride</li><li>Ferulic Acid</li><li>Magnesium Carbonate</li><li>Malachite Green</li><li>Metanyl Yellow</li><li>Nitric Acid</li><li>Paraffin Wax</li><li>Phosporic Acid TG &amp; FG</li><li>Potassium Carbonate</li><li>Potassium Chloride</li><li>Potassium Hydroxide (Caustic Potash)</li><li>Potassium Permanganate</li><li>Sodium CMC Technical Grade</li><li>Sodium Dihcloro Iso Cyanuric Acid 60 % (SDIC)</li><li>Sodium Hexametaphosphate TG</li><li>Sodium Metabisulphite</li><li>Sodium Tripolyphosphate TG</li><li>Talcum Powder (30)</li><li>Talcum Powder (mesh 800, 1000, 1250)</li><li>Titanium Dioxide Anatase</li><li>Titanium Dioxide Rutile (Various Grade)</li><li>Trichloro Iso Cyanuric Acid 90 %</li><li>Trisodium Phosphate Anhydrous</li><li>Ultramarine Blue</li><li>Zinc Oxide</li><li>Various Kind of Industrial Enzyme</li></u