(2, '1657098948_plastic-resin.jpg', 'Plastic Resin / Compound and Engineering Plastic', 'Plastic Resin / Compound and Engineering Plastic', 'plastic-resin-compound-and-engineering-plastic', 'Pertama dan Pelopor dalam industri Senyawa Plastik dan masterbatch di Indonesia. Menjual Resin plastik seperti ABS, SAN, Polycarbonate, SBS, TPE, TPR, Nylon dan aditif plastik.', 'The first and Pioneer in the Plastic Compounds and masterbatches industry in Indonesia. Selling plastic Resin such as ABS, SAN, Polycarbonate, SBS, TPE, TPR, Nylon and plastics additives.', '<p style=\"font-family: Roboto, sans-serif;\">Pertama dan Pelopor dalam industri Senyawa Plastik dan masterbatch di Indonesia. Menjual Resin plastik seperti ABS, SAN, Polycarbonate, SBS, TPE, TPR, Nylon dan aditif plastik.</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Calcium Carbonate and Talc Masterbatch</li><li>Color Masterbatch</li><li>Black and White Masterbatch</li><li>Functional Masterbatch (Anti static masterbatch, etc)</li><li>Color Compound (polylefin, polystyrene, engineering plastic)</li><li>Impact Modifier (polyolefin, polystyrene)</li><li>Thermoplastic Rubber (TPR)</li><li>Thermoplastic Elastomer (TPE)</li><li>Eva foam compound</li><li>ABS Resin</li><li>AS Resin (SAN)</li><li>Polycarbonate (PC)</li><li>Nylon 6/66</li><li>Polybutylene Terephthala (PBT)</li><li>Polyacetal (POM)</li></ul>', '<p style=\"font-family: Roboto, sans-serif;\">The first and Pioneer in the Plastic Compounds and masterbatches industry in Indonesia. Selling plastic Resin as ABS, SAN, Polycarbonate, SBS, TPE, TPR, Nylon and plastics additives.</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Calcium Carbonate and Talc Masterbatch</li><li>Color Masterbatch</li><li>Black and White Masterbatch</li><li>Functional Masterbatch (Anti static masterbatch, etc)</li><li>Color Compound (polylefin, polystyrene, engineering plastic)</li><li>Impact Modifier (polyolefin, polystyrene)</li><li>Thermoplastic Rubber (TPR)</li><li>Thermoplastic Elastomer (TPE)</li><li>Eva foam compound</li><li>ABS Resin</li><li>AS Resin (SAN)</li><li>Polycarbonate (PC)</li><li>Nylon 6/66</li><li>Polybutylene Terephthala (PBT)</li><li>Polyacetal (POM)</li></ul>', '2022-07-06 02:15:48', '2022-07-28 02:17:07'),
(3, '1657099220_feed-additive-products.jpg', 'Feed Additive Products', 'Feed Additive Products', 'feed-additive-products', 'Kami juga mengembangkan bisnis imbuhan pakan ternak yang berkualitas untuk mendukung industri peternakan di Indonesia. Produk yang kami sediakan meliputi nutrisi tambahan untuk ternak dan nutrisi spesial untuk peternakan unggas, peternakan sapi dan industri perikanan seperti tambak', 'We also expand our business of high quality animal feed additives to support the livestock industry in Indonesia. The products we supply include additional nutrition for livestock and special nutrition for poultry farming, cattle farming and fishing industries such as ponds', '<p style=\"font-family: Roboto, sans-serif;\">Portofolio bahan pangan yang berkualitas dan beragam kami hadirkan untuk menjadi solusi industri makanan yang ada di Indonesia. Produk yang kami hadirkan mulai dari pengatur keasaman, pengawet, pemanis, perisa, pengemulsi, penstabil dan lainnya.</p><p style=\"font-family: Roboto, sans-serif;\">a. Antibiotic</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Amoxyciline</li><li>Ciprofloxacine</li><li>Chlortetracyclin HCl</li><li>Diclazuril</li><li>Doxycycline HCl</li><li>Enrofloxacine</li><li>Erythromycin Thiocyanate</li><li>Neomycin Sulphate</li><li>Norfloxacine</li><li>Olaquindox</li><li>Oxytetracycline</li><li>Sulphadiazine Sodium</li><li>Tylosin Tartrate</li><li>Trimethoprim</li><li>Zinc Bacitracin</li></ul><p style=\"font-family: Roboto, sans-serif;\">b. Anthelmentic</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Albendazole</li><li>Levamisole</li><li>Niclosamide</li><li>Piperazine Citrate</li></ul><p style=\"font-family: Roboto, sans-serif;\">c. Mineral</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Cobalt Sulphate</li><li>Copper Sulphate</li><li>Dicalcium Phosphate 18%</li><li>Ferrous Sulphate</li><li>Magnesium Oxide / Sulphate</li><li>Manganese Oxide / Sulphate</li><li>Monodicalcium Phosphate 21%</li><li>Monocalcium Phosphate 22%</li><li>Zinc Oxide / Sulphate White Seal</li></ul><p style=\"font-family: Roboto, sans-serif;\">d. Sanitary Materials</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Benzalkonium Chloride 50 %</li><li>Benzalkonium Chloride 80 %</li><li>Calcium Hypochlorite 70 %</li><li>Potassium Permanganate (PK)</li><li>Trichloro Isocyanuric Acid (TCCA) 90%</li></ul><p style=\"font-family: Roboto, sans-serif;\">e. Vitamin</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Biotin</li><li>Choline Chloride</li><li>D-Calcium Panthothenate</li><li>Folic Acid</li><li>Vitamin A</li><li>Vitamin B1 Mono</li><li>Vitamin B2</li><li>Vitamin B3 (Nicotinic / Nicotinamide)</li><li>Vitamin B6</li><li>Vitamin C</li><li>Vitamin D3</li><li>Vitamin E50</li><li>Vitamin K3</li></ul><p style=\"font-family: Roboto, sans-serif;\">f. Amino Acid&nbsp;</p><ul style=\"font-family: Roboto, sans-serif;\"><li>L-Threonin</li><li>L-Lysine</li></ul><p style=\"font-family: Roboto, sans-serif;\">g. Others</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Active Dry Yeast</li><li>Anticaking</li><li>Antimold</li><li>Cyromazine</li><li>Filler</li><li>Feed Colour</li><li>Pellet Binder</li><li>Calcium Propionate</li></ul>', '<p style=\"font-family: Roboto, sans-serif;\">We provide high quality and diverse food ingredients to be a solution for the food industry in Indonesia. The products we present start from acidity regulators, preservatives, sweeteners, flavors, emulsifiers, stabilizers, and others.</p><p style=\"font-family: Roboto, sans-serif;\">a. Antibiotic</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Amoxyciline</li><li>Ciprofloxacine</li><li>Chlortetracyclin HCl</li><li>Diclazuril</li><li>Doxycycline HCl</li><li>Enrofloxacine</li><li>Erythromycin Thiocyanate</li><li>Neomycin Sulphate</li><li>Norfloxacine</li><li>Olaquindox</li><li>Oxytetracycline</li><li>Sulphadiazine Sodium</li><li>Tylosin Tartrate</li><li>Trimethoprim</li><li>Zinc Bacitracin</li></ul><p style=\"font-family: Roboto, sa