(4, '1657099433_food-ingredient-products.jpg', 'Food Ingredient Products', 'Food Ingredient Products', 'food-ingredient-products', 'Portofolio bahan pangan yang berkualitas dan beragam kami hadirkan untuk menjadi solusi industri makanan yang ada di Indonesia. Produk yang kami hadirkan mulai dari pengatur keasaman, pengawet, pemanis, perisa, pengemulsi, penstabil dan lainnya.', 'We provide high quality and diverse food ingredients to be a solution for the food industry in Indonesia. The products we present start from acidity regulators, preservatives, sweeteners, flavors, emulsifiers, stabilizers, and others.', '<p style=\"font-family: Roboto, sans-serif;\">Kami juga mengembangkan bisnis imbuhan pakan ternak yang berkualitas untuk mendukung industri peternakan di Indonesia. Produk yang kami sediakan meliputi nutrisi tambahan untuk ternak dan nutrisi spesial untuk peternakan unggas, peternakan sapi dan industri perikanan seperti tambak&nbsp;</p><p style=\"font-family: Roboto, sans-serif;\">a. Acidulant and Buffering Agent</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Acetic Acid</li><li>Citric Acid Anhydrous</li><li>Citric Acid Monohydrate</li><li>DL Malic Acid</li><li>Glucono Delta Lactone</li><li>Phosphoric Acid</li><li>Potassium Citrate</li><li>Sodium Citrate</li><li>Tartaric Acid</li></ul><p style=\"font-family: Roboto, sans-serif;\">b. Anti Oxidant</p><ul style=\"font-family: Roboto, sans-serif;\"><li>BHA</li><li>BHT</li><li>Vitamin A</li><li>Vitamin C</li><li>Vitamin E (Oil)</li></ul><p style=\"font-family: Roboto, sans-serif;\">c. Baking Ingredients</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Ammonium Bicarbonate</li><li>Baking enzymes</li><li>Baking Powder</li><li>Bread Softener (Rimulsoft Super)</li><li>Cake Emulsifier (Ryoto Ester SP)</li><li>Calcium Propionate</li><li>Bread Improver</li><li>Cornstarch</li><li>Glucono Delta Lactone</li><li>Sodium Acid Pyrophosphate</li><li>Sodium Bicarbonate</li><li>Sodium Metabisulphite Food Grade</li><li>