(5, '1657099567_ceramic-raw-material.jpg', 'Ceramic Raw Material', 'Ceramic Raw Material', 'ceramic-raw-material', 'Kami berkomitmen untuk mendukung industri keramik di Indonesia untuk menyediakan bahan baku berkualitas seperti berbagai tingkatan aluminium oksida, feldspar, barium karbonat untuk produk keramik ATH Anda, dll.', 'We commit to support the ceramic industry in Indonesia in providing high quality raw materials such as various grades of aluminum oxide, feldspar, barium carbonate for ATH ceramic products, etc.', '<p style=\"font-family: Roboto, sans-serif;\">Berbagai tingkatan aluminium oksida, feldspar, barium karbonat untuk produk keramik ATH Anda, dll.</p><p style=\"font-family: Roboto, sans-serif;\">a. Chemical For Ceramic</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Aluminum Hydroxide (ATH)</li><li>Aluminum Oxide</li><li>Barium Carbonate</li><li>Barium Sulphate</li><li>Chromium Oxide (Chrome Oxide Green)</li><li>Magnesium Oxide</li><li>Potassium Feldspar</li><li>Sodium CMC</li><li>Sodium Feldspar</li><li>Sodium Tripolyphosphate</li><li>Nephelyne Syenite</li></ul>', '<p style=\"font-family: Roboto, sans-serif;\">Various grades of aluminum oxide, feldspar, barium carbonate for your ceramic products ATH, etc.</p><p style=\"font-family: Roboto, sans-serif;\">a. Chemical For Ceramic</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Aluminum Hydroxide (ATH)</li><li>Aluminum Oxide</li><li>Barium Carbonate</li><li>Barium Sulphate</li><li>Chromium Oxide (Chrome Oxide Green)</li><li>Magnesium Oxide</li><li>Potassium Feldspar</li><li>Sodium CMC</li><li>Sodium Feldspar</li><li>Sodium Tripolyphosphate</li><li>Nephelyne Syenite</li></ul>', '2022-07-06 02:26:07', '2022-07-28 02:16:14'),
(6, '1657100126_paint-Ink-chemical-product.jpg', 'Paint / Ink Chemical Product', 'Paint / Ink Chemical Product', 'paint-ink-chemical-product', 'Kami menghadirkan berbagai macam warna pigmen organik dan anorganik, hitam karbon untuk pewarnaan lapisan dan aplikasi plastik, resin untuk aplikasi tinta, pengisi fungsional dan nano kalsium karbonat untuk tinta dan cat, aspal teroksidasi, dll.', 'We Provide assorted colors of organic and inorganic pigments, carbon black for coloring your coating and plastic application, resins for ink applications, functional fillers and nano calcium carbonate for ink and paint, oxidized bitumen, etc.', '<p style=\"font-family: Roboto, sans-serif;\">Berbagai macam warna pigmen organik dan anorganik, hitam karbon untuk pewarnaan lapisan dan aplikasi plastik, resin untuk aplikasi tinta, pengisi fungsional dan nano kalsium karbonat untuk tinta dan cat, aspal teroksidasi, dll.</p><p style=\"font-family: Roboto, sans-serif;\">a. Ink and Paint Chemical</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Antiblocking Agent (Minbloc)</li><li>Blown Asphalt</li><li>Barium Sulfate (precipitated)</li><li>Calcium Carbonate (Activated Collodial)</li><li>Calcium Carbonate Light</li><li>Calcined Kaolin (Britex)</li><li>CLiQ Coating Additive (Wetting, antifoaming, Dispersing agent, thixotropic, etc.,)</li><li>Copolymer of PVC, PVAC and PVA (Solbin Series)</li><li>EVA Copolymer</li><li>Chlorinated Polypropylene Resin</li><li>Glass beads (for road marking paint)</li><li>Hydrogenated Hydrocarbon Resin</li><li>Hydrocarbon Resin(C5, C9)</li><li>Polyvinyl Butyral resin (S Lec Series)</li><li>Potassium Aluminum Silicate (Minex)</li><li>Copolymer of PVC-VAC (CP Series)</li><li>Petroleum Resin C9</li><li>Polyamide Resin</li><li>Silica Sand</li></ul><p style=\"font-family: Roboto, sans-serif;\">b. Pigments</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Aluminum Paste</li><li>Pearlescent Pigment</li><li>Specialty Carbon Black (powder and beads type)</li><li>Chrome Yellow Deep</li><li>Chrome Yellow Lemon</li><li>Chrome Yellow Medium</li><li>Iron Oxide (Red, Yellow, Green)</li><li>Molybdate Orange</li><li>Titanium Dioxide Anatase</li><li>Titanium Dioxide Rutile (Various Grade)</li><li>Organic Pigment ex China<ul><li>Red 2</li><li>Red 48:2</li><li>Red 49:1</li><li>Red 53:1</li><li>Red 63:1</li><li>Red 57:1</li><li>Red 112</li><li>Red 122</li><li>Red 254</li><li>Yellow 1</li><li>Yellow 12</li><li>Yellow 13</li><li>Yellow 14</li><li>Yellow 74</li><li>Yellow 83</li><li>Orange 13</li><li>Orange 34</li><li>Blue 15:0</li><li>Blue 15:1</li><li>Blue 15:3</li><li>Milori Blue</li><li>Green 7</li><li>Violet 3</li><li>Violet 23</li><li>Ultramarine Blue</li><li>Solvent Dyes</li></ul></li></ul>', '<p style=\"font-family: Roboto, sans-serif;\">Assorted colors of organic and inorganic pigments, carbon black for coloring your coating and plastic application, resins for ink applications, functional fillers and nano calcium carbonate for ink and paint, oxidized bitumen, etc..</p><p style=\"font-family: Roboto, sans-serif;\">a. Ink and Paint Chemical</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Antiblocking Agent (Minbloc)</li><li>Blown Asphalt</li><li>Barium Sulfate (precipitated)</li><li>Calcium Carbonate (Activated Collodial)</li><li>Calcium Carbonate Light</li><li>Calcined Kaolin (Britex)</li><li>CLiQ Coating Additive (Wetting, antifoaming, Dispersing agent, thixotropic, etc.,)</li><li>Copolymer of PVC, PVAC and PVA (Solbin Series)</li><li>EVA Copolymer</li><li>Chlorinated Polypropylene Resin</li><li>Glass beads (for road marking paint)</li><li>Hydrogenated Hydrocarbon Resin</li><li>Hydrocarbon Resin(C5, C9)</li><li>Polyvinyl Butyral resin (S Lec Series)</li><li>Potassium Aluminum Silicate (Minex)</li><li>Copolymer of PVC-VAC (CP Series)</li><li>Petroleum Resin C9</li><li>Polyamide Resin</li><li>Silica Sand</li></ul><p style=\"font-family: Roboto, sans-serif;\">b. Pigments</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Aluminum Paste</li><li>Pearlescent Pigment</li><li>Specialty Carbon Black (powder and beads type)</li><li>Chrome Yellow Deep</li><li>Chrome Yellow Lemon</li><li>Chrome Yellow Medium</li><li>Iron Oxide (Red, Yellow, Green)</li><li>Molybdate Orange</li><li>Titanium Dioxide Anatase</li><li>Titanium Dioxide Rutile (Various Grade)</li><li>Organic Pigment ex China<ul><li>Red 2</li><li>Red 48:2</li><li>Red 49:1</li><li>Red 53:1</li><li>Red 63:1</li><li>Red 57:1</li><li>Red 112</li><li>Red 122</li><li>Red 254</li><li>Yellow 1</li><li>Yellow 12</li><li>Yellow 13</li><li>Yellow 14</li><li>Yellow 74</li><li>Yellow 83</li><li>Orange 13</li><li>Orange 34</li><li>Blue 15:0</li><li>Blue 15:1</li><li>Blue 15:3</li><li>Milori Blue</li><li>Green 7</li><li>Violet 3</li><li>Violet 23</li><li>Ultramarine Blue</li><li>Solvent Dyes</li></ul></li></ul>', '2022-07-06 02:35:26', '2022-07-28 02:15:59'),
(7, '1657100540_metal.jpg', 'Metal', 'Metal', 'metal', 'Kami berpengalaman dalam mensuplai bahan baku logam yang biasa digunakan dalam proses pelapisan dan galvanisasi seperti Lead Ingot yang banyak digunakan di industry kabel, baterai kendaraan dan kawat solde, Zinc Alloy Ezda 3 yang banyak digunakan untuk industry otomotif, elektronik hingga perhiasan serta Zinc anode SHG (Spesial High Grade) yang berperan penting dalam industry baja. Saat ini kami ditunjuk sebagai distributor dari Nyrstar (salah satu produsesn ternama di dunia) untuk pasar Indonesia', 'We are experienced in supplying metal raw materials that are used in the coating and galvanization processes such as Lead Ingot which is widely used in the cable industry, vehicle battery and soldering wire, Zinc Alloy Ezda 3 which is widely used for the automotive, also electronics to jewelry industries and Zinc anode SHG (Special High Grade) which play an important role in the steel industry. We are currently appointed as distributor of Nyrstar (one of the world\'s leading manufacturers) for the Indonesian market.', '<p style=\"font-family: Roboto, sans-serif;\">Seperti yang kita ketahui, banyak logam yang biasa digunakan dalam proses pelapisan dan galvanisasi, kami mensuplai beberapa logam tersebut seperti Lead Ingot, Zinc Alloy Ezda 3 dan Zinc Anode SHG sebagai distributor dari Nyrstar, salah satu produsen ternama di dunia. Lead Ingot adalah logam lunak yang termasuk dalam golongan Non Ferrous Metal dengan karakter mudah dibentuk, dapat ductable, dan biasa digunakan untuk meningkatkan ketahanan terhadap korosi. Aplikasi utama dalam tenaga industri dan penyimpanan daya seperti kabel listrik dan komunikasi bawah air, baterai kendaraan serta pasokan listrik energi operasi dan juga digunakan dalam industri kawat solder. Zinc Alloy Ezda 3 merupakan paduan paduan logam Zinc dan logam Alluminium (ZnAl-4%) dengan karakteristik mekanik, castability, dan stabilitas dimensi yang baik. Aplikasi utama dalam diecasting industri seperti die casting untuk suku cadang otomotif, komponen elektronik, garmen dan perhiasan. Zinc Metal adalah logam dalam golongan Non Ferrous Metal dengan aplikasi besar. Aplikasi utama logam seng untuk industri Oksida, industri paduan, lapisan galvanisasi dan dilapisi. Zinc Anode SHG (Special High Grade) terutama digunakan dalam baja galvanis untuk mencegah karat, pada paduan seng diecasting dan paduan tembaga (kuningan). Seng juga penting untuk mendorong pertumbuhan berbagai jenis organisme, baik tumbuhan maupun hewan. Seng juga memperpanjang umur material lain seperti baja (dengan hot dipping atau electrogalvanizing), karet dan plastik (sebagai penghambat penuaan) dan kayu (sebagai cat).</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Lead Ingot</li><li>Nickel Plate</li><li>Nickel Square</li><li>Zinc Alloy EZDA 3</li><li>Zinc Anode SHG</li></ul>', '<p style=\"font-family: Roboto, sans-serif;\">As we know, there are many metals commonly used in plating and galvanizing process, we supply some of those metals such as Lead Ingot, Zinc Alloy Ezda 3 and Zinc Anode SHG as a distributor of Nyrstar, a well known producer in the world. Lead Ingot is soft metal in the group Non Ferrous Metal with the character malleable, ductable metal, and commonly used to improve corrosion resistance. Main application is in industrial power and power storage such as underwater power and communication cables, vehicle batteries as well as operating energy power supplies and also used in solder wire industries. Zinc Alloy Ezda 3 is an alloying combination Zinc metal and Alluminium metal ( ZnAl-4% ) with a good mechanic characteristic, castability and dimension stability. Main application is in industrial diecasting such as die casting for automotive parts, electronic parts, garments and jewelery. Zinc Metal is the metal in the group Non Ferrous Metal with the large application. Zinc metal major application for Oxide industry, alloying industry, galvanizing and electroplated coating. Zinc Anode SHG ( Special High Grade ) mainly used in galvanizing steel to prevent rusting, in zinc diecasting alloys and copper alloys ( brass ). Zinc is also essential to promote growth of many kind of organism, both plant and animals. Zinc also extend the life of other material such as steel ( by hot dipping or electrogalvanizing ), rubber and plastic ( as an aging inhibitor ) and wood ( as a paint ).</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Lead Ingot</li><li>Nickel Plate</li><li>Nickel Square</li><li>Zinc Alloy EZDA 3</li><li>Zinc Anode SHG</li></ul>', '2022-07-06 02:42:20', '2022-07-28 02:14:04'),
(8, '1657100861_electroplating-chemical-product.jpg', 'Electroplating Chemical Products', 'Electroplating Chemical Productss', 'electroplating-chemical-products', 'Kami dapat menyediakan berbagai logam yang biasa digunakan dalam proses elektroplating, yang juga dikenal sebagai elektrodeposisi dan lapisan dilapisi, seperti tembaga, nikel, emas, perak, krom, seng dan timah. Kami mewakili produsen bahan kimia pelapisan listrik terkenal seperti Yuken, Meltex, Ishihara, Kanigen dan Geomet.', 'We have a wide variety of metals used in electroplating process, also known as electrodeposition and electroplated coating, such as copper, nickel, gold, silver, chrome, zinc and tin. We represent well known producers of electroplating chemicals like Yuken, Meltex, Ishihara, Kanigen and Geomet.', '<p style=\"font-family: Roboto, sans-serif;\">Elektroplating adalah proses pelapisan logam dengan lapisan timah dari logam lain dengan cara elektrolisis untuk meningkatkan ketahanan logam terhadap korosi. Logam yang biasa digunakan dalam proses pelapisan adalah tembaga, nikel, emas, perak, krom, seng dan timah. Proses elektroplating juga dikenal sebagai elektrodeposisi dan lapisan dilapisi. Kami mewakili produsen bahan kimia pelapisan listrik terkenal seperti Yuken, Meltex, Ishihara, Kanigen dan Geomet.</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Chromic Acid</li><li>Copper Sulphate</li><li>Elumin O</li><li>Nickel Chloride</li><li>Nickel Sulphate</li><li>Nikkasan Lacquer</li><li>Nitric Acid</li><li>Sodium Hypophosphite</li><li>Stannous Chloride</li><li>Stannous Sulphate</li><li>Copper Pyrophosphate</li><li>Potassium Pyrophosphate</li><li>Stannous Pyrophosphate</li><li>Pre-Treatment ( Pakuna ) : Acid - Degreasing - Electro Cleaning Agents</li><li>Acid Zinc Brighteners ( Metasu )</li><li>Alkaline Zinc Brighteners ( Metasu )</li><li>Zinc Passivation ( Metasu ) : Black 3+, Silver 3+</li><li>Abrasive Barrel Media ( Tipton )</li><li>Barrel Compound ( Tipton )</li><li>Shot Blasting ( Tipton )</li><li>Geomet Coating</li></ul>', '<p style=\"font-family: Roboto, sans-serif;\">Electroplating is the process of coating a metal with the tin layer of another metal by electrolysis to improve the metal corrosion resistance. The metals commonly used in plating process are copper, nickel, gold, silver, chrome, zinc and tin. Electroplating process also known as electrodeposition and electroplated coating. We represent well known producers of electroplating chemicals like Yuken, Meltex, Ishihara, Kanigen and Geomet.</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Chromic Acid</li><li>Copper Sulphate</li><li>Elumin O</li><li>Nickel Chloride</li><li>Nickel Sulphate</li><li>Nikkasan Lacquer</li><li>Nitric Acid</li><li>Sodium Hypophosphite</li><li>Stannous Chloride</li><li>Stannous Sulphate</li><li>Copper Pyrophosphate</li><li>Potassium Pyrophosphate</li><li>Stannous Pyrophosphate</li><li>Pre-Treatment ( Pakuna ) : Acid - Degreasing - Electro Cleaning Agents</li><li>Acid Zinc Brighteners ( Metasu )</li><li>Alkaline Zinc Brighteners ( Metasu )</li><li>Zinc Passivation ( Metasu ) : Black 3+, Silver 3+</li><li>Abrasive Barrel Media ( Tipton )</li><li>Barrel Compound ( Tipton )</li><li>Shot Blasting ( Tipton )</li><li>Geomet Coating</li></ul>', '2022-07-06 02:47:41', '2022-07-28 02:11:28'),
(9, '1657101050_plywood-glue-and-adhesive.jpg', 'Plywood Glue and Adhesive', 'Plywood Glue and Adhesive', 'plywood-glue-and-adhesive', 'Dengan pengalaman yang luas dalam memasok lem kayu lapis dan industri perekat, kami dikenal sebagai mitra yang baik karena konsisten dalam menyediakan bahan baku dan aditif berkualitas tinggi untuk produsen lem dan perekat kayu lapis dalam negeri.', 'With tremendous experience in supplying for plywood glue and adhesive industries, we have been known as a leading partner for our consistency in providing high quality of raw materials and additives to domestic plywood glue and adhesives manufacturers.', '<p style=\"font-family: Roboto, sans-serif;\">Sebagai perusahaan yang mapan, kami memiliki pengalaman luar biasa dalam memasok lem kayu lapis dan industri perekat, dan kami juga dikenal sebagai mitra yang baik karena konsisten dalam menyediakan bahan baku dan aditif berkualitas tinggi untuk produsen lem dan perekat kayu lapis dalam negeri.</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Hexamine</li><li>Magnesium Oxide</li><li>Cornstarch</li><li>Citric Acid</li><li>Disodium Phosphate ( DSP )</li><li>Monosodium Phosphate ( MSP )</li></ul>', '<p style=\"font-family: Roboto, sans-serif;\">As a well established company, we have tremendous experiences to supply plywood glue and adhesives industries, and we are also known as a leading partner for its consistency in providing high quality of raw materials and additives to domestic plywood glue and adhesives manufacturers.</p><ul style=\"font-family: Roboto, sans-serif;\"><li>Hexamine</li><li>Magnesium Oxide</li><li>Cornstarch</li><li>Citric Acid</li><li>Disodium Phosphate ( DSP )</li><li>Monosodium Phosphate ( MSP )</li></ul>', '2022-07-06 02:50:51', '2022-07-28 02:13:51'),
(10, '1657101295_pvc.jpg', 'PVC Additives', 'PVC Additives', 'pvc-additives', 'Kami memiliki pengalaman lebih dari 40 tahun dalam mensuplai berbagai jenis stabilisator PVC, plasticizer, pelumas dan aditif PVC lainnya untuk berbagai macam aplikasi seperti pipa, fitting, profile, sheet, kulit imitasi, dan berbagai jenis kompon (kabel, sepatu, sendal, dll).', 'We have more than 40 years experience in supplying various kind of PVC stabilizers, plasticizers, lubricants and other PVC additives for many kind of application such as pipe, fitting, profile, sheet, imitation leather, and various kind of compound (cable, shoes, sandals, etc).', '<p style=\"font-family: Roboto, sans-serif;\">Kami memiliki pengalaman lebih dari 40 tahun dalam mensuplai berbagai jenis stabilisator PVC, plasticizer, pelumas dan aditif PVC lainnya seperti kalsium karbonat, zat pencerah optik (OB-1), polietilen terklorinasi, pengubah benturan, alat bantu pemrosesan, anti oksidan, anti UV , titanium dioksida, anti fogging, dll untuk berbagai macam aplikasi seperti pipa, fitting, profile, sheet, kulit imitasi, dan berbagai jenis kompon (kabel, sepatu, sendal, dll).</p><p style=\"font-family: Roboto, sans-serif;\"><span style=\"font-weight: bolder;\">a. Liquid Stabilizer</span></p><ul style=\"font-family: Roboto, sans-serif;\"><li>Barium Zinc Stabilizer</li><li>Barium Zinc Kicker</li><li>Cadmium Barium Zinc</li><li>Cell Control Agent for PVC Foam</li><li>Calcium Zinc (Ca/Zn) Stabilizer</li></ul><p style=\"font-family: Roboto, sans-serif;\"><span style=\"font-weight: bolder;\">b. Non-Liquid Stabilizers (Powder/Flake Forms)</span></p><ul style=\"font-family: Roboto, sans-serif;\"><li>Calcium Stearate, Barium Stearate, Zinc Stearate, Lead Stearate, Magnesium Stearate, Cadmium Stearate</li><li>Dibasic Lead Sulphate ( DBL )</li><li>Tribasic Lead Stearate ( T3/TS )</li><li>Barium Zinc</li><li>Cadmium Barium Lead</li><li>One Pack Stabilizers : Lead Based, Ca/Zn Based</li></ul><p style=\"font-family: Roboto, sans-serif;\"><span style=\"font-weight: bolder;\">c. Plasticizers</span></p><ul style=\"font-family: Roboto, sans-serif;\"><li>Epoxy Soybean Oil (ESBO/ESO)</li><li>EFAME ( Epoxy Fatty Acid Methyl Ester )</li><li>Dioctyl Phtalate ( DOP )</li><li>Dioctyl Adipate ( DOA )</li><li>Trioctyl Trimellitate ( TOTM )</li><li>Polymeric Plasticizers ( ADK PN series )</li></ul><p style=\"font-family: Roboto, sans-serif;\"><span style=\"font-weight: bolder;\">d. Lubricants</span></p><ul style=\"font-family: Roboto, sans-serif;\"><li>Butyl Stearate</li><li>Polyethylene Wax ( PE Wax )</li><li>Gliseryl Mono Stearate ( GMS / Rikemal )</li><li>Fatty Acid Esters ( Rikester )</li><li>Kalcohol (Coco Alcohol)</li><li>Stearic Acid</li></ul><p style=\"font-family: Roboto, sans-serif;\"><span style=\"font-weight: bolder;\">e. Other PVC Additives</span></p><ul style=\"font-family: Roboto, sans-serif;\"><li>Calcium Carbonate</li><li>Optical Brightening Agents ( OB-1 )</li><li>UV Absorbers</li><li>Chlorinated Polyethylene (CPE 135 A)</li><li>Impact Modifiers (Metablen C)</li><li>Processing Aid (Metablen P)</li><li>PVC Paste Resin</li><li>Colour Pigments</li><li>Anti Oxidant</li><li>Anti UV</li><li>Anti Fogging</li></ul>', '<p style=\"font-family: Roboto, sans-serif;\">We have more than 40 years experience in supplying various kind of PVC stabilizers, plasticizers, lubricants and other PVC additives such as calcium carbonate, optical brightening agent ( OB-1 ), chlorinated polyethylene, impact modifiers, processing aid, anti oxidant, anti UV, titanium dioxide, anti fogging, etc for many kind of application such as pipe, fitting, profile, sheet, imitation leather, and various kind of compound (cable, shoes, sandals, etc).</p><p style=\"font-family: Roboto, sans-serif;\"><span style=\"font-weight: bolder;\">a. Liquid Stabilizer</span></p><ul style=\"font-family: Roboto, sans-serif;\"><li>Barium Zinc Stabilizer</li><li>Barium Zinc Kicker</li><li>Cadmium Barium Zinc</li><li>Cell Control Agent for PVC Foam</li><li>Calcium Zinc (Ca/Zn) Stabilizer</li></ul><p style=\"font-family: Roboto, sans-serif;\"><span style=\"font-weight: bolder;\">b. Non-Liquid Stabilizers (Powder/Flake Forms)</span></p><ul style=\"font-family: Roboto, sans-serif;\"><li>Calcium Stearate, Barium Stearate, Zinc Stearate, Lead Stearate, Magnesium Stearate, Cadmium Stearate</li><li>Dibasic Lead Sulphate ( DBL )</li><li>Tribasic Lead Stearate ( T3/TS )</li><li>Barium Zinc</li><li>Cadmium Barium Lead</li><li>One Pack Stabilizers : Lead Based, Ca/Zn Based</li></ul><p style=\"font-family: Roboto, sans-serif;\"><span style=\"font-weight: bolder;\">c. Plasticizers</span></p><ul style=\"font-family: Roboto, sans-serif;\"><li>Epoxy Soybean Oil (ESBO/ESO)</li><li>EFAME ( Epoxy Fatty Acid Methyl Ester )</li><li>Dioctyl Phtalate ( DOP )</li><li>Dioctyl Adipate ( DOA )</li><li>Trioctyl Trimellitate ( TOTM )</li><li>Polymeric Plasticizers ( ADK PN series )</li></ul><p style=\"font-family: Roboto, sans-serif;\"><span style=\"font-weight: bolder;\">d. Lubricants</span></p><ul style=\"font-family: Roboto, sans-serif;\"><li>Butyl Stearate</li><li>Polyethylene Wax ( PE Wax )</li><li>Gliseryl Mono Stearate ( GMS / Rikemal )</li><li>Fatty Acid Esters ( Rikester )</li><li>Kalcohol (Coco Alcohol)</li><li>Stearic Acid</li></ul><p style=\"font-family: Roboto, sans-serif;\"><span style=\"font-weight: bolder;\">e. Other PVC Additives</span></p><ul style=\"font-family: Roboto, sans-serif;\"><li>Calcium Carbonate</li><li>Optical Brightening Agents ( OB-1 )</li><li>UV Absorbers</li><li>Chlorinated Polyethylene (CPE 135 A)</li><li>Impact Modifiers (Metablen C)</li><li>Processing Aid (Metablen P)</li><li>PVC Paste Resin</li><li>Colour Pigments</li><li>Anti Oxidant</li><li>Anti UV</li><li>Anti Fogging</li></ul>', '2022-07-06 02:54:55', '2022-07-28 02:13:40');
