(153, 'Baking Ingredients', 'Food Ingredient', '<span style=\"color: #FF0000\">Baking Powder (SP-Top) </span>', 'Baking Powder <br /><br />\n\n<strong>Usage:</strong><br />  \nAs a leavening agent in cakes, snacks and crackers.<br /><br />\n\n<strong>Recommended dosage:</strong> <br />\n0.5 – 2% of total flour<br /><br />\n\n<strong>Packaging:</strong><br />\n15 kg/ box and 25 kg/bag', 'SP-TOP.jpg'),
(154, 'Baking Ingredients', 'Food Ingredient', 'Bread Softener (Rimulsoft Super)', '', 'nopic.jpg'),
(155, 'Baking Ingredients', 'Food Ingredient', '<span style=\"color: #FF0000\">Cake Emulsifier (Ryoto Ester SP)</span>', '<strong>Benefits:</strong><br />\n1. Bakers are able to mix all ingredients together (except oil/margarine)<br />\n2. Produce bigger volume of cake with even and smooth pores<br />\n3. Cakes are able to stay soft for a couple of days<br />\n4. Stabilize cake dough 2-3 hours before baking/steaming<br />\n5. Reduce the use of eggs<br /><br />\n\n<strong>Direction of use:</strong><br />\n1. Mix directly into dough (for all kinds of methods)<br />\n2. Used for cake, bread, pastry and crackers<br /><br />\n\n<strong>Recommended dosage</strong><br />\n• 2-3% of total flour, egg and sugar<br /><br />\n\n<strong>Storage:</strong> <br />\nroom temperature<br /><br />\n\n<strong>Packaging:</strong> <br />\n100 gram/tub<br />\n1 kg/ bag or tub<br />\n5kg/pail<br />\n15kg/pail<br />', 'ryoto-ester-SP2.jpg'),
(156, 'Baking Ingredients', 'Food Ingredient', 'Calcium Propionate', '', 'nopic.jpg'),
(412, 'Flavours and Food Colours', 'Food Ingredient', 'Erythrosine', '', 'nopic.jpg'),
(158, 'Baking Ingredients', 'Food Ingredient', '<span style=\"color: #FF0000\">Bread Improver (Boost)</span>', '<strong>Benefits:</strong><br />\n1. Speed up mixing time<br />\n2. Increase dough volume<br />\n3. Decrease ?final proofing? time<br /><br />\n\n<strong>Recommended dosage:</strong><br />\n0.3-0.5 % of total flour<br /><br />\n\n<strong>Packaging: </strong><br />\n10 kg/box\n', 'Boost1.jpg'),
