(311, 'Plastic Resin/ Compound and Engineering Plastic', 'Plastics', '<span style=\"color: #FF0000\">ABS & ABS Colour Compound (Hailac) </span>', '<span style=\"font-size:18px;color:#333333\"><strong>ABS COLOUR COMPOUND</strong></span><br />\n<br />\n\n<p>“Hailac” is P.T Halim Samudra Interutama’s brand name for ABS (Acrylonitrile (A), Butadine (B) and Styrene (S)). ABS is a very tough plastic with high gloss and excellent scratch resistance.</p>\n<p>ABS obtains combination of excellent properties by using Acrylonitrile for high Tensile Strength and     chemical resistance, Butadiene for Impact Strength and Styrene for Hardness, Gloss and improved processability. Hailac™ (ABS color compound) is a compound material for injection molding which has already been color matched. It is the most convenient molding compound as it does not require any mixing or blending of natural ABS with pigments/ colorants.</p>\n<p>ABS resin is widely used in various Electrical and Electronic housing/components, Automotive parts, Toys, Helmet, Office Automation, pipes, etc. It features high impact, high flexural strength, excellent mechanical properties, chemical resistance, easy to inject, good dimensional stability and can be Painted as well as Electro Plated. <br />\n</p>\n<p><br />\n</p>', 'hailac_pproduct1.jpg'),
(312, 'Plastic Resin/ Compound and Engineering Plastic', 'Plastics', 'AS Resin (SAN)', '', 'nopic.jpg'),
(313, 'Plastic Resin/ Compound and Engineering Plastic', 'Plastics', '<span style=\"color:#FF0000\">Calcium Carbonate Masterbatch Compound (Haipet)</span>', '<span style=\"font-size:18px;color:#333333\"><strong>Calcium Carbonate Masterbatch Compound</strong></span><br /><br />\n\nHAIPET™ is a kind of masterbatches consists of   75 % – 85 % CaCO3 and 15 % – 25% specially blended polyolefin resin with special additives. HAIPET™ is used as an additive for polyolefin resin.<br /><br />\nHAIPET™ was originally developed to be used as an additive (Anti Splitting Agent) in PP Woven Bag/      PP Yarn Industries. By the time, especially with the high increase in Polyolefin Resin price, HAIPET™ started to be used in HDPE shopping bag industries as an alternative to reduce costs. <br /><br />\n  To better serve the HAIPET™ market, especially for the purpose of COSTS REDUCTION, P.T. HALIM    SAMUDRA INTERUTAMA has been developing many GRADES of HAIPET™ for different kind of applications.<br /><br />\nCurrently, we have more than 10 grades of      HAIPET™, Economical, Standard and High/           Superior grades of HAIPET™.<br /><br />', 'Haipet.jpg'),
(314, 'Plastic Resin/ Compound and Engineering Plastic', 'Plastics', '<span style=\"color: #FF0000\">Black & White Masterbatch (Haimaster)', '<span style=\"font-size:15px;color:#333333\"><strong>BLACK, WHITE AND ADDITIVES MASTERBATCHES</strong></span><br />\n<br />\n\n<p>Haimaster™ is PT. Halim Samudra Interutama’s brand name for Masterbatches (Black, White and Additives Masterbatches). We have provided Customers with a wide range of standard asterbatches and we sincerely welcome any request for specific Colors and applications/ needs. </p>\n<p>Quality consistency to Customers is ASSURED through a well established QUALITY ASSURANCE SYSTEM that was developed by our 20 years experience in the field of Masterbatches. Before delivery, all products should have been going through the QUALITY ASSURANCE SYSTEM. To be more precise, QUALITY ASSURANCE SYSTEM is established based on the application of the                     Masterbatches “ONE QUALITY ASSURANCE SYSTEM for one application”. QUALITY is further assured by suitable quality control equipments which are operated by  well qualified people who have had  long experience in the field of Masterbatches. </p>\n<p>Our Masterbatches is widely used in LDPE, LLDPE, HDPE, PP, GPPS, HIPS, ABS, PET, SAN, PC, PMMA, Nylon, etc, for Film, Injection, Extrusion and Blow Molding applications. </p>\n<p><br />\n</p>', 'haimaster_product1.jpg'),
(315, 'Plastic Resin/ Compound and Engineering Plastic', 'Plastics', '<span style=\"color: #FF0000\">Color Masterbatch (Haimaster )</span>', '<span style=\"font-size:18px;color:#333333\"><strong>COLOR MASTERBATCHES</strong></span><br />\n<br />\n\n<p>Haimaster™ is PT. Halim Samudra Interutama’s brand name for Masterbatches (Color Masterbatches). We have provided Customers with a wide range of standard Masterbatches and we sincerely welcome any request for specific Colors and applications/ needs. </p>\n<p>Quality consistency to Customers is ASSURED through a well established QUALITY ASSURANCE SYSTEM that was developed by our 20 years experience in the field of Masterbatches. Before delivery, all products should have been going through the QUALITY ASSURANCE SYSTEM. To be more precise, QUALITY ASSURANCE SYSTEM is established based on the application of the Masterbatches “ONE QUALITY ASSURANCE SYSTEM for one application”. QUALITY is further assured by suitable quality control equipments which are operated by  well qualified people who have had  long experience in the field of Masterbatches. </p>\n<p>Our Masterbatches is widely used in LDPE, LLDPE, HDPE, PP, GPPS, HIPS, ABS, PET, SAN, PC, PMMA, Nylon, etc, for Film, Injection, Extrusion and Blow Molding applications. </p>\n<p><br />\n</p>', 'haimaster_product.jpg'),
