(317, 'Plastic Resin/ Compound and Engineering Plastic', 'Plastics', 'EVA Masterbatch', '', 'nopic.jpg'),
(318, 'Plastic Resin/ Compound and Engineering Plastic', 'Plastics', '<span style=\"color:#FF0000\">Elastomer Compound (Haibam)</span>', '<p>HAIBAM™ is our Brand Name for Thermo Plastic Olefin (TPO), Thermo Plastic Elastomer (TPE) and Impact Modifier. </p>\n<span style=\"font-size:18px;color:#333333\"><strong>HAIBAM H</strong></span><br />\n  HAIBAM H is Polyolefin Based Elastomeric, a unique semi crystalline copolymers of Polyolefin Resins. They have excellent elastomeric properties, are easy to process and compatible with all kinds of PE and PP Resins. HAIBAM H is  particularly effective for polyolefin blends where a balance of flexibility, transparency and impact  performance is required, and it is very good additive to be used as Processing Aid in the production of PE and PP Film/ Injection/              Extrusion.</p>\n<p>The combination of the advantages given by HAIBAM H presents a potential for innovation currently unavailable  in other polyolefin resins.</p>\n<p> Advantages of HAIBAM H :<br />\n  - Transparency<br />\n  - Stress Whitening.<br />\n  - Soft,Comfort-touch.<br />\n  - Anti-slip.<br />\n  - Increased  tear  strength  and  compression  set  in <br />\n  foams PP.<br />\n  - Improved  Impact  resistance,  good  flexibility  and <br />\n  elasticity in tubing,hose,profile,packaging,sheet and <br />\n  membranes etc.</p>\n<p>&nbsp;</p>\n<span style=\"font-size:18px;color:#333333\"><strong>HAIBAM PS</strong></span><br />\n  <p>HAIBAM PS is a Copolymer of Styrene and           Butadiene, with a high content of Butadiene Rubber. HAIBAM PS is used as Impact Modifier for Styrenic products, especially HIPS. It improves the Impact Strength and Elongation of HIPS.<br />\n</p><br />\n<span style=\"font-size:18px;color:#333333\"><strong>HAIBAM E</strong></span><br />\n  Haibam E Thermoplastic Elastomer (TPE) has     combines performance cheracteristic of vulcanized rubber,such as heat resistance and low compression set, with the processing ease of thermoplastic. It offers the dual advantages of low cost thermoplastic processing and vulcanized rubber performance. </p>\n<p>As a result, Haibam E has been finding a rapid acceptance in a broad variety of industrial and consumer-oriented rubber product    applications.</p>\n<p> The hardness range of Haibam E, permits the design and manufactured of parts ranging       from flexible to semi rigid, while maintaining the broad range of favorable physical properties.</p>\n<p>The low specific gravity of Haibam E compare to vulcanized specialty rubber such as polychloroprene chlorosulfonated polyethylene and EPDM gives 20% to 30% lighter weight in a unit basis of a specific part.</p>\n<p>The process of Haibam E “TPE” is associated with the economy of processing thermoplastic, such as :<br />\n  - Injection molding<br />\n  - Extrusion<br />\n  - Blow molding and<br />\n  - Calendaring</p>\n<p>&nbsp;</p>', 'HAIBAM_product1.jpg'),
