(326, 'Plastic Resin/ Compound and Engineering Plastic', 'Plastics', '<span style=\"color: #FF0000\">Thermo Plastic Rubber/ TPR (Haiton)</span>', '<span style=\"font-size:18px;color:#333333\"><strong>Thermoplastic Rubber Compound</strong></span><br />\n<br />\n\n<p>“Thermoplastic Rubber Compound” is a compound based on  Styrene Butadiene Coplymer.  We provide a wide range of hardness for different applications and can be tailored made to meet some specific applications. </p>\n<p>The main application of HAITON is for Shoe Sole (out sole for casual shoes) as the replacement for Rubber and PVC.  It has advantages over rubber and PVC due to its light weight, anti slip property and recycleable. </p>\n<p><br />\n</p>', 'haiton_pproduct1.jpg'),
