(365, 'Plastic Resin/ Compound and Engineering Plastic', 'Plastics', '<span style=\"color: #FF0000\">Haiprene</span>', 'Haiprene&#8482  is PT. Halim Samudra Interutama color and natural compounds from solution  Polymerization, Styrene Ethylene / Butylenes Blokcopolymer. Characteristics  Haiprene&#8482 is a linear / high molecular weight, superior weather and  heat resistance, high strength, and good compability with polyolefin plastics.  These components are synthetic rubber compounds.<br />\r\n\r\n<br />\r\n<strong>Characteristic:</strong><br />\r\n\r\n<ul>\r\n  <li>Excellent impact resistance</li>\r\n  <li>Easy colorability</li>\r\n  <li>Tough yet flexible</li>\r\n  <li>Low density and light weight</li>\r\n  <li>Easy mixing, forming and processing on plastic or  rubber equipment</li>\r\n  <li>Recycable for in process scrap re-use</li>\r\n  <li>Lower shrinkage</li>\r\n</ul>\r\n<br />\r\n\r\n\r\n', 'nopic.jpg'),
(366, 'Plastic Resin/ Compound and Engineering Plastic', 'Plastics', '<span style=\"color: #FF0000\">Talc Masterbatch (Haital)</span>', '<p>Haital™ a is a kind of masterbatches consists of 60 % – 80 % Mineral Talc and 20 % – 40 % specially blended polyolefin resin with special additives. <br />\nCost reduction is essential for PP injection that becomes more competitive every year.</p>\n<p>Benefits of HAITAL in Polypropylene products :<br />\n  - Cost Reduction, while increasing output<br />\n  - Increase Stiffness (E-Modulus) and Impact Strength<br />\n  - Increase Thermal Conductivity<br />\n  - Nucleation<br />\n  - Reduce mould shrinkage and enhance dimensional stability<br />\n  - Deflection Temperature<br />\n  - Creep Resistance<br />\n  - Better Barrier properties<br />\n  - Chemical Resistance<br />\n</p>', 'nopic.jpg'),
(367, 'Plastic Resin/ Compound and Engineering Plastic', 'Plastics', '<span style=\"color: #FF0000\">Custom Pigment Powder (Haicolor)</span>', '<span style=\"font-size:18px;color:#333333\"><strong>POWDER FORM PIGMENT PREPARATION</strong></span><br />\n<br />\n\n<p>HAICOLOR™ is Pigment Preparation in powder form produced from normal powder pigments which is coated and dispersed by special Additives, Dispersing Agent and Lubricant. It is used to replace conventional powder pigment. </p>\n<p>The benefit of using HAICOLOR™ include :</p>\n<p>- Easy disperse<br />\n  - Less dust as compare to Pigment Powder<br />\n  - Can be Tailored  Made  to  meet  specific  requirement of COLORS, Needs and Applications.</p>\n<br /><p>Haicolor™ is a including additive, lubricant and dispersing agent. Use this color chart as an approximation of the real color. If exact color matching is necessary, use actual sample of the materials.</p>', 'nopic.jpg'),
(368, 'Sarigandum', 'Food Ingredient', '<span style=\"color: #FF0000\">Kencana A1</span>', 'Flour specially created for making premium quality bread, in term of volume, crumb texture, appearance and mouthfeel and also suitable for making high quality noodles with excellent elasticity and texture. <br />\n<br />\n<strong>Information Facts</strong><br />\n<table width=\"300\" border=\"0\" cellpadding=\"0\">\n  <tr>\n    <td>Moisture (%)</td>\n    <td>max.14.3</td>\n  </tr>\n  <tr>\n    <td>Protein (%)(Nx5.7)(db)</td>\n    <td>min. 13.0</td>\n  </tr>\n  <tr>\n    <td>Ash (%)(db)</td>\n    <td>max. 0.6</td>\n  </tr>\n  <tr>\n    <td>Falling Number (sec.)</td>\n    <td>min. 300</td>\n  </tr>\n  <tr>\n    <td>Wet Gluten (%)</td>\n    <td>min. 32</td>\n  </tr>\n  <tr>\n    <td>Water Absorbtion (%)</td>\n    <td>60-64</td>\n  </tr>\n</table>', 'kencana-A15.jpg'),
(369, 'Sarigandum', 'Food Ingredient', '<span style=\"color: #FF0000\">Kencana Prima</span>', 'Multipurpose flour, created for making excellent quality baked foods, <br />\ni.e. bread, tart, sponge cake, doughnut and noodle.<br />\n<br />\n<strong>Information Facts</strong> \n<br />\n<table width=\"300\" border=\"0\" cellpadding=\"0\">\n  <tr>\n    <td>Moisture (%)</td>\n    <td>max.14.3</td>\n  </tr>\n  <tr>\n    <td>Protein (%)(Nx5.7)(db)</td>\n    <td>min. 11.0</td>\n  </tr>\n  <tr>\n    <td>Ash (%)(db)</td>\n    <td>max. 0.6</td>\n  </tr>\n  <tr>\n    <td>Falling Number (sec.)</td>\n    <td>min. 300</td>\n  </tr>\n  <tr>\n    <td>Wet Gluten (%)</td>\n    <td>min. 28</td>\n  </tr>\n  <tr>\n    <td>Water Absorbtion (%)</td>\n    <td>58-62</td>\n  </tr>\n</table>', 'kencana-prima.jpg'),
(370, 'Sarigandum', 'Food Ingredient', '<span style=\"color: #FF0000\">Kencana Pusaka</span>', 'Flour Specially used for making cookies, crackers, biscuits, wafer and various kind of snacks with excellent quality and nutritious. <br /><br />\n\n<strong> Information Facts <br />\n</strong>\n<table width=\"300\" border=\"0\" cellpadding=\"0\">\n  <tr>\n    <td>Moisture (%)</td>\n    <td>max.14.3</td>\n  </tr>\n  <tr>\n    <td>Protein (%)(Nx5.7)(db)</td>\n    <td>10.0 - 11.0</td>\n  </tr>\n  <tr>\n    <td>Ash (%)(db)</td>\n    <td>max. 0.6</td>\n  </tr>\n  <tr>\n    <td>Falling Number (sec.)</td>\n    <td>min. 300</td>\n  </tr>\n  <tr>\n    <td>Wet Gluten (%)</td>\n    <td>26 - 398</td>\n  </tr>\n  <tr>\n    <td>Water Absorbtion (%)</td>\n    <td>56 - 58</td>\n  </tr>\n</table>', 'kencana-pusaka.jpg'),
(371, 'Sarigandum', 'Food Ingredient', '<span style=\"color: #FF0000\">Kencana Snacker</span>', 'Economical flour, specially created for various kinds of snacks, cookies and crackers which make them more crispy, delicious and tastier.<br /><br />\n\n<strong> Information Facts <br />\n</strong>\n<table width=\"300\" border=\"0\" cellpadding=\"0\">\n  <tr>\n    <td>Moisture (%)</td>\n    <td>max.14.3</td>\n  </tr>\n  <tr>\n    <td>Protein (%)(Nx5.7)(db)</td>\n    <td>9.0 - 10.0</td>\n  </tr>\n  <tr>\n    <td>Ash (%)(db)</td>\n    <td>max. 0.6</td>\n  </tr>\n  <tr>\n    <td>Falling Number (sec.)</td>\n    <td>min. 300</td>\n  </tr>\n  <tr>\n    <td>Wet Gluten (%)</td>\n    <td>max. 25</td>\n  </tr>\n  <tr>\n    <td>Water Absorbtion (%)</td>\n    <td>55 - 57</td>\n  </tr>\n</table>', 'kencana-snacker.jpg'),
